import "./App.css";
import { BrowserRouter } from "react-router-dom";
import { Fragment } from "react";
import Home from "./pages/Home";
import Navbar from "components/Navbar";

function App() {
  return (
    <BrowserRouter>
      <Fragment>
        <Navbar />
        <Home />
      </Fragment>
    </BrowserRouter>
  );
}

export default App;
